async function getNurse()
{

     let url='http://localhost:5000/api/Users?type=4';

     try
     {
      let res = await fetch(url);
      return await res.json();
     }
     catch (error)
     {
        console.log(error);
     }

}



async function render()
{

let babies = await getNurse();


var imgData = [{"imgURL" : "data:image/jpeg;base64,"}];
//document.getElementById("sora").src = imgData[0].imgURL;

let html='';
babies.forEach(element => {

   let htmlSegment = `<div class="card col-10 col-sm-5 col-md-5 col-lg-4 col-xl-3  ">
                                <div class="pic" >
                                <button style="border:0px solid transparent; width:100%; background:transparent"><img src="${imgData[0].imgURL}"></button>                                 </div>
                                <p  class="tit1" style="margin:10px" > Nurse Name : <span > ${element.name}</span></p>
                                <p style="margin:10px">E-mail : <span> </span> ${element.email}</p>
                                 </div>`;

   
   html += htmlSegment;
});

let container = document.querySelector('.containerNurse');
container.innerHTML=html;

}





render();